import { Observable, of, Subject } from 'rxjs';
import { delay, map, tap } from 'rxjs/operators';

import { Injectable } from '@angular/core';

import { ProfileImage } from '../model/profile_image';
import { ProfileImageService } from './profile-image.service';

@Injectable({
  providedIn: 'root'
})
export class MockProfileImageService extends ProfileImageService {

  public DELAY = 2000;
  private data: ProfileImage[] = [
    {
      id: 'minidam01.png',
      image: 'data:image/png;base64,',
      createdAt: new Date(),
    },
    {
      id: 'minidam02.png',
      image: 'data:image/png;base64,',
      createdAt: new Date(),
    },
    {
      id: 'minidam05.jpg',
      image: 'data:image/jpeg;base64,',
      createdAt: new Date(),
    },
  ];

  constructor() {
    super();
  }

  public loadImages(): Observable<ProfileImage[]> {
    return of([...this.data]).pipe(
      delay(this.DELAY),
    );
  }

  public delete(image: ProfileImage): Observable<void> {
    for (let idx = 0; idx < this.data.length; ++idx) {
      if (this.data[idx].id === image.id) {
        this.data.splice(idx, 1);
      }
    }
    // of(void) だとエラーが起きる。
    return of('dummy').pipe(
      delay(this.DELAY),
      tap(() => {
        console.log('hogehoge');
        this.change.next();
      }),
      map((_) => { return; }),
    );
  }

  public upload(data: string): Observable<ProfileImage> {
    const profileImage: ProfileImage = {
      id: (new Date()).getTime().toString(),
      image: data,
      createdAt: new Date(),
    };
    this.data.push(profileImage);
    return of(profileImage).pipe(
      delay(this.DELAY),
      tap(() => {
        this.change.next();
      }),
    );
  }
}
